import time
import torch

# Microbenchmarks to simulate patterns seen in model_runner.py

def bench_with_tensor_default(iterations: int) -> float:
    d = {}
    acc = 0.0
    for _ in range(iterations):
        acc += d.get("model_forward_time", torch.tensor(0.0)).item()
    return acc


def bench_without_tensor_default(iterations: int) -> float:
    d = {}
    acc = 0.0
    for _ in range(iterations):
        t = d.get("model_forward_time")
        acc += t.item() if t is not None else 0.0
    return acc


def run():
    iters = 200_000

    t0 = time.perf_counter()
    r1 = bench_with_tensor_default(iters)
    t1 = time.perf_counter()

    t2 = time.perf_counter()
    r2 = bench_without_tensor_default(iters)
    t3 = time.perf_counter()

    print({
        "iters": iters,
        "with_tensor_default_time_s": round(t1 - t0, 6),
        "without_tensor_default_time_s": round(t3 - t2, 6),
        "dummy_results": (r1, r2),
    })


if __name__ == "__main__":
    run()

